import React from "react";
// import MainNavBar from "../Components/MainNavBar";
import Style from "../Styles/About.module.css";
import { Link } from "react-router-dom";
import * as Icon from "react-bootstrap-icons";
function BasicPage() {
  return (
    <div>
      {/* <MainNavBar /> */}
      <div className={Style.dmain}>
        <div className={Style.doctor}>
          <div className={Style.image}>
            <img
              src="https://thumbs.dreamstime.com/b/science-medicine-concepts-portrait-female-lab-staff-dealing-flasks-substances-laboratory-environment-vertical-70583460.jpg"
              width="100%"
              alt="logo"
              style={{ marginLeft: 100 }}
            />
          </div>
          <div className={Style.docLink}>
            <Link to="/lab/signin" className={Style.link}>
              Labaratory
            </Link>
          </div>
        </div>
        <div className={Style.patient}>
          <img
            src="https://cdn.pixabay.com/photo/2022/11/08/09/10/patient-7578055__340.png"
            width="200"
            height="300"
            alt="logo"
            style={{ marginLeft: 100 }}
          />
          <div className={Style.docLink}>
            <Link to="/patient/signin" className={Style.link}>
              Patient 
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default BasicPage;
